import JsCookie from "js-cookie"

export default function CheckCookie() {

    const cookieFound = JsCookie.get( 'rememberMe' ) !== undefined

    console.log( "'Remember Me' -cookie " +
        (
            cookieFound ?
                "found" :
                "not found"
        )
    )

    return cookieFound
}
